import styled from 'styled-components'

export const HeaderContainer = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 30px;

  & .header-heading {
    font-size: 36px;
    letter-spacing: 3px;
    color: #d91818;
    width: 20%;
  }
`
